Interesujesz się tworzeniem filmów? Marzysz o tym, by poznać tajniki reżysersko-operatorskie i chciałbyś się dowiedzieć, jak montować nagrany kamerą materiał? Koniecznie przekonaj swojego nauczyciela, by zgłosił Twój udział w bezpłatnych warsztatach w Warszawie! Trwa rekrutacja na warsztaty filmowe „Filmoteka Szkolna. Akademia”. Uczniowie szkół ponadpodstawowych z całej Polski mają szansę zrealizować filmy krótkometrażowe pod opieką profesjonalistów z Warszawskiej Szkoły Filmowej. W ramach zajęć
..........
) - 12.03.2017 (niedziela) - 18.03.2017 (sobota) - 19.03.2017 (niedziela) UWAGA: Terminy warsztatów na kwiecień i maj zostaną ogłoszone 27 lutego 2017 r. Nauczyciel / opiekun może zgłosić maksymalnie 7 osób. Prosimy o wybór jednego terminu. Zapisy na warsztaty przyjmowane są poprzez formularz zgłoszeniowy dostępny TUTAJ. Liczba miejsc jest ograniczona. Pierwszeństwo udziału mają szkoły, które nie uczestniczyły jeszcze w projekcie „Filmoteka Szkolna. Akademia”. Udział w zajęciach jest bezpłatny.
